import React, { useState, useEffect } from 'react';
import './App.css';

// Component for horizontal scrolling category
const Category = ({ name, videos, onEdit, onDelete }) => (
  <div className="category">
    <h2>{name}</h2>
    <div className="video-scroll">
      {videos.map(video => (
        <VideoCard key={video.id} video={video} onEdit={() => onEdit(video)} onDelete={() => onDelete(video.id)} />
      ))}
    </div>
  </div>
);

// Component for individual video cards
const VideoCard = ({ video, onEdit, onDelete }) => (
  <div className="video-card">
    <img src={video.thumbnail} alt={video.title} />
    <h3>{video.title}</h3>
    <p>Rating: {video.rating}/5</p>
    <button onClick={onEdit}>Edit</button>
    <button onClick={onDelete}>Delete</button>
  </div>
);

// Component for adding/editing videos
const VideoForm = ({ video, onSave, onCancel }) => {
  const [formData, setFormData] = useState(video || { title: '', category: '', link: '', thumbnail: '', rating: 0 });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSave(formData);
  };

  return (
    <form onSubmit={handleSubmit}>
      <input name="title" value={formData.title} onChange={handleChange} placeholder="Title" required />
      <input name="category" value={formData.category} onChange={handleChange} placeholder="Category" required />
      <input name="link" value={formData.link} onChange={handleChange} placeholder="Video Link" required />
      <input name="thumbnail" value={formData.thumbnail} onChange={handleChange} placeholder="Thumbnail Link" required />
      <input name="rating" type="number" min="0" max="5" value={formData.rating} onChange={handleChange} placeholder="Rating" required />
      <button type="submit">Save</button>
      <button type="button" onClick={onCancel}>Cancel</button>
    </form>
  );
};

const App = () => {
  const [videos, setVideos] = useState([]);
  const [categories, setCategories] = useState([]);
  const [editingVideo, setEditingVideo] = useState(null);

  useEffect(() => {
    // Load data from localStorage on component mount
    const savedVideos = JSON.parse(localStorage.getItem('videos')) || [];
    setVideos(savedVideos);
    updateCategories(savedVideos);
  }, []);

  useEffect(() => {
    // Save data to localStorage whenever videos change
    localStorage.setItem('videos', JSON.stringify(videos));
    updateCategories(videos);
  }, [videos]);

  const updateCategories = (videoList) => {
    const uniqueCategories = [...new Set(videoList.map(video => video.category))];
    setCategories(uniqueCategories);
  };

  const handleSaveVideo = (videoData) => {
    if (videoData.id) {
      setVideos(videos.map(v => v.id === videoData.id ? videoData : v));
    } else {
      setVideos([...videos, { ...videoData, id: Date.now() }]);
    }
    setEditingVideo(null);
  };

  const handleDeleteVideo = (id) => {
    setVideos(videos.filter(v => v.id !== id));
  };

  return (
    <div className="app">
      <h1>DIY Video Library</h1>
      <button onClick={() => setEditingVideo({})}>Add New Video</button>
      {editingVideo && (
        <VideoForm
          video={editingVideo}
          onSave={handleSaveVideo}
          onCancel={() => setEditingVideo(null)}
        />
      )}
      {categories.map(category => (
        <Category
          key={category}
          name={category}
          videos={videos.filter(video => video.category === category)}
          onEdit={setEditingVideo}
          onDelete={handleDeleteVideo}
        />
      ))}
    </div>
  );
};

export default App;
